const t=JSON.parse('{"key":"v-96945dbe","path":"/%E6%95%B0%E6%8D%AE%E7%BB%93%E6%9E%84/%E9%93%BE%E8%A1%A8.html","title":"链表","lang":"zh-CN","frontmatter":{"description":"链链表 是一种非常常见的数据结构，它是一种线性表，但是并不会按线性的顺序存储数据，而是在每一个节点里存到下一个节点的指针(Pointer)。这给了链表非常大的灵活性，可以随意的在任意位置插入，删除，拼接等等。但这也使得链表的访问较为困难，因为链表的每个节点并不是连续存储的，所以不能像数组一样，通过下标就能访问到某个节点，必须从头开始遍历，直到找到目标节点。","head":[["meta",{"property":"og:url","content":"https://PoIndex.github.io/%E6%95%B0%E6%8D%AE%E7%BB%93%E6%9E%84/%E9%93%BE%E8%A1%A8.html"}],["meta",{"property":"og:site_name","content":"现代黑魔法学院"}],["meta",{"property":"og:title","content":"链表"}],["meta",{"property":"og:description","content":"链链表 是一种非常常见的数据结构，它是一种线性表，但是并不会按线性的顺序存储数据，而是在每一个节点里存到下一个节点的指针(Pointer)。这给了链表非常大的灵活性，可以随意的在任意位置插入，删除，拼接等等。但这也使得链表的访问较为困难，因为链表的每个节点并不是连续存储的，所以不能像数组一样，通过下标就能访问到某个节点，必须从头开始遍历，直到找到目标节点。"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"og:updated_time","content":"2023-11-27T03:31:43.000Z"}],["meta",{"property":"article:author","content":"西风逍遥游"}],["meta",{"property":"article:modified_time","content":"2023-11-27T03:31:43.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"链表\\",\\"image\\":[\\"\\"],\\"dateModified\\":\\"2023-11-27T03:31:43.000Z\\",\\"author\\":[{\\"@type\\":\\"Person\\",\\"name\\":\\"西风逍遥游\\",\\"url\\":\\"https://github.com/sunxfancy\\"}]}"]]},"headers":[],"git":{"createdTime":1688356618000,"updatedTime":1701055903000,"contributors":[{"name":"西风逍遥游","email":"sunxfancy@gmail.com","commits":2},{"name":"Xiaofan Sun","email":"sunxfancy@gmail.com","commits":1}]},"readingTime":{"minutes":0.52,"words":157},"filePathRelative":"数据结构/链表.md","localizedDate":"2023年7月3日","autoDesc":true}');export{t as data};
